description:
Digital Dreams (1983 - UK)

Biography / Fantasy / Music

starring . . . James Coburn, Richard O'Brien, Charlie Watts, Bill Wyman
 &lt;a href=&quot;
http://www.imdb.com/title/tt0233571/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt0233571/&lt;/a&gt;


Bill Wyman crosses the fine line between dreams and reality when his passion for documenting his life on computer is seen as an obsession for those around him. A rich, full tapestry of the life and times of Bill Wyman through which are woven whimsical fantasy sequences, historical slices of his career with the world's greatest rock and roll band ever, the Rolling Stones, and intimate psycho-dramatic glimpses behind the public mask of this superstar. Bill Wyman, already confirmed as the eternal archivist, purchased a computer that made him one of the first people in the UK to own an Apple home computer.


Video: MPEG4 Video (H264), 640x480, 29.970 fps, 2006 kbps, 01h11m05s
Audio: AAC, 48000 Hz, stereo, 192 kbps

